import React, { Component } from 'react'
import NewsItems from './NewsItems'

export class NewsShow extends Component {
  render() {
    return (
      <div className='container my-3'>
        <NewsItems/>
        <NewsItems/>
        <NewsItems/>
        <NewsItems/>

      </div>
    )
  }
}

export default NewsShow
